function start_hyper(e = {
    timeOut: 0
}) {
    $("#testar").html("Please wait....");
    var pk = $("#pk").val() ? $("#pk").val() : '',
        cs = $("#cs").val() ? $("#cs").val() : "",
        gate = $("#type").val() ? $("#type").val() : "titan",
        email = $("#email").val(),
        amount = $("#amt").val(),
        tg_id = $("#tg_id").val(),
        proxy = $("#proxy").val(),
        r = $("#lista").val().split("\n"),
        l = r.length,
        s = 0,
        o = 0,
        n = 0,
        a = 0,
        i = 0,
        c = 0,
        d = 0;
    (function(e = "type") {
        "type" === e && window.alert("Please select a valid type");
    })(o),
    (function(e) {
        null !== e || "" !== e ?
            window.localStorage.setItem("getsk", e) :
            e !== window.localStorage.getItem("getsk") &&
            window.localStorage.setItem("getsk", e);
    })(n),
    (function(e) {
        "type" !== e || "" !== e ?
            window.localStorage.setItem("type", e) :
            e !== window.localStorage.getItem("type") &&
            window.localStorage.setItem("type", e);
    })(o),
     (function(e) {
        "forward" !== e || "" !== e ?
            window.localStorage.setItem("forward", e) :
            e !== window.localStorage.getItem("forward") &&
            window.localStorage.setItem("forward", e);
    })(o),
    (function(e) {
        "123" !== e || "" !== e ?
            window.localStorage.setItem("teleid", e) :
            e !== window.localStorage.getItem("teleid") &&
            window.localStorage.setItem("teleid", e);
    })(a),
    r.forEach(function(r, u) {
        setTimeout(function() {
            $.ajax({
                url: "/process?cc=" +
                    r +'&gate='+gate,
                type: "GET",
                async: !0,
                success: function(e) {
                    e.match("HITS") ?
                        (removelinha(),
                            d++,
                            charged(e + ""),
                            tata.success("", e, {
                                duration: 5e3
                            })) :
                        e.match("LIVE") ?
                        (removelinha(),
                            s++,
                            aprovadas(e + ""),
                            tata.success("", e, {
                                duration: 5e3
                            })) :
                        e.match("#CCN") ?
                        (removelinha(), i++, edrovadas(e + "")) :
                        (removelinha(), c++, reprovadas(e + "")),
                        $("#carregadas").html(l);
                    var t = parseInt(d) + parseInt(s) + parseInt(i) + parseInt(c);
                    $("#cLive").html(s),
                        $("#cWarn").html(i),
                        $("#cDie").html(c),
                        $("#total").html(t),
                        $("#cLive3").html(d),
                        $("#cLive2").html(s),
                        $("#cWarn2").html(i),
                        $("#cDie2").html(c);
                    var a = (t / l) * 100,
                        o = "[" + t + " checked] processing..." + a.toFixed(0) + "%";
                    $(".gline").css({
                            width: a.toFixed(0) + "%"
                        }),
                        $("#testar").html(o),
                        100 === a && $("#testar").html("✅ Completed!");
                },
            });
        }, e.timeOut * 0);
    });
}

function charged(e) {
    $(".charged").append(e + "<br>");
}

function aprovadas(e) {
    $(".aprovadas").append(e + "<br>");
}

function reprovadas(e) {
    $(".reprovadas").append(e + "<br>");
}

function edrovadas(e) {
    $(".edrovadas").append(e + "<br>");
}

function removelinha() {
    var e = $("#lista").val().split("\n");
    e.splice(0, 1), $("#lista").val(e.join("\n"));
}
